import axios from 'axios';

const API = axios.create({
    baseURL: 'https://pixabay.com/api/',
    header:{
       Accept: 'application/json',
       'Access-Control-Allow-Origin': '*',
       'Content-type': 'application/json' 
    }, 
    params: {
        key: process.env.PIXABAY_API_KEY,
        safesearch: true,
    },
})

export default API;
